import { useLocation } from 'react-router-dom';




const Scorepage = () => {
    document.body.style.fontFamily='Nunito, sans-serif';
    document.body.style.background="#1976D2"
    document.body.style.color="white"

    const location = useLocation();
const score = location.state && location.state.score;


  return (
   
       
    
        <div style={{ background: 'black', width: '50%', height: '700px', marginTop: '80px', marginLeft: '490px' }} className='rounded-lg'>
          <h1 className='text-9xl'>{score}</h1> 
        </div>
    );
};
   

export default Scorepage
